import "../App.css"
const Nav = () =>{


    return(
    <>
    <div id="body">
       <div id="face"><h1>facebook</h1></div> 
        <h4 id="faceContent">Facebook helps you connect and share <br></br>with the people in your life</h4>
        
        <div id="body1">
            <input id="inp" placeholder="email or username"></input>
            <input id="inp1" placeholder="password"></input>
            <div id="login">login</div>
            <div id="password">forgotten pasword?</div>
            <div id="border"></div>
            <h6 id="create" >create new account</h6>
           < div><a>create a page</a></div>
      </div>
     </div>
    </>
    )
}
export default Nav





